import React, { Component } from 'react';
import axios from "axios";
import Input from '../Register/Input';
import Button from "../Register/Button";

export default class Login extends Component {
  constructor(props){
    super(props);
    this.state = {
      regis : {
        name: "",
        email: "",
        password: ""
      }
    }
  }

  postRegister = () => {
    axios.post("http://localhost:3004/register", this.state.regis).then(res => {
      console.log(res)
      // console.log(res.data)
      this.setState({
        regis : {
          id: 1,
          name: "",
          email: "",
          password: ""
        }
      })
    })
  }

  handleChangeRegister = (e) => {
    let register = this.state.regis
    // let timeStamp = new Date().getTime()
    // console.log(timeStamp)
    // register["id"] = timeStamp
    register[e.target.name] = e.target.value
    // console.log(e.target.name)
    this.setState({
      regis : register
    })
  }

  handleSubmitRegister = e => {
    this.postRegister()
    console.log("succes button")
  }

  render() {
    return (
      <div onSubmit={this.handleSubmitRegister}>
        <Input type="text" textIsi="name" name="name" value={this.state.regis.name} onChange={this.handleChangeRegister} />
        <Input type="email" textIsi="email" name="email" value={this.state.regis.email} onChange={this.handleChangeRegister} />
        <Input type="password" textIsi="Silahkan isi password" name="password" value={this.state.regis.password} onChange={this.handleChangeRegister} />
        <Button nameButton="Register"onClick={this.handleSubmitRegister} />
      </div>
    )
  }
}
